import React, { useState } from 'react';
import { RefreshCw, ShoppingBag } from 'lucide-react';

const Header = ({ onMarketplaceOpen }) => {
  return (
    <header className="bg-white border-b border-aws-gray-200 shadow-sm">
      <div className="max-w-7xl mx-auto px-6 py-4">
        <div className="flex items-center justify-between">
          {/* Logo and Title */}
          <div className="flex items-center space-x-4">
            <div className="bg-aws-orange p-2 rounded-lg">
              <svg className="w-8 h-8 text-white" viewBox="0 0 24 24" fill="currentColor">
                <path d="M12 2L2 7l10 5 10-5-10-5zM2 17l10 5 10-5M2 12l10 5 10-5"/>
              </svg>
            </div>
            <div>
              <h1 className="text-2xl font-semibold text-aws-blue">LambdaForge</h1>
              <p className="text-aws-gray-600 text-sm">Lambda-First Infrastructure: Built by AI, Managed by Serverless</p>
            </div>
          </div>

          {/* Navigation Controls */}
          <div className="flex items-center space-x-6">
            {/* API Status Indicator */}
            <div className="flex items-center space-x-3">
              <div className="flex items-center space-x-2">
                <div className="w-2 h-2 bg-green-500 rounded-full animate-pulse" title="API Online"></div>
                <span className="text-sm text-aws-gray-600 font-medium">API Online</span>
              </div>
            </div>

            {/* Reset All */}
            <button className="flex items-center space-x-2 bg-aws-gray-50 border border-aws-gray-300 text-aws-gray-700 px-4 py-2 rounded-lg font-medium hover:bg-aws-gray-100 transition-all duration-200">
              <RefreshCw className="w-4 h-4" />
              <span className="text-sm">Reset All</span>
            </button>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
